'use strict';


var game ;
var fonts_loaded = false;
var doc_loaded = false;

require('../bower_components/howler.js/dist/howler.min');
var WebFontLoader = require('../bower_components/webfontloader/webfontloader');

require('../bower_components/phaser-state-transition/dist/phaser-state-transition.min');
require('./objects/coin');
require('./objects/hitDisplay');


WebFontLoader.load({
  custom: {
    families: ['Neutra Text', 'Neutra Text Bold'],
    urls: ['../css/styles.css']
  },
  active: function() { fonts_loaded = true; initGame(); }
});


var fx_state, fx_good, fx_bad, fx_seconds;

//global variables
window.onload = function () {
  doc_loaded = true;


  // Attempt to Init Game
  initGame();
};

var initGame = function(){
  //console.log(fonts_loaded+"   "+doc_loaded+"    "+game)
  if((!fonts_loaded || !doc_loaded)){
    return;
  }

  game = new Phaser.Game(1024, 768, Phaser.CANVAS, 'benson-hedges');


  game.coins_max = 10;
  game.coins_total = 0;
  game.coins_same_time = 2;
  game.level = 1;
  game.level_speed = 1;
  game.score = 0;
  game.score_max = 20;
  game.endGame = false;
  game.total_timeup = Phaser.Timer.MINUTE;

  game.font_style = {
    font: 'Neutra Text',
    fontSize: '34pt',
    fontStyle: 'normal',
    fill: '#000000',
    align: 'center',
    wordWrap: true,
    wordWrapWidth: 980,
    boundsAlignH: "center",
    boundsAlignV: "middle"
  }


  // Game Sound FX
  game.fx_state = new Howl({
    src: [
      'data:audio/mp3;base64,',
      'data:audio/mp4;base64,',
      'data:audio/ogg;base64,',
    ]
  });
  game.fx_good = new Howl({
    src: [
      'data:audio/mp3;base64,',
      'data:audio/mp4;base64,',
      'data:audio/ogg;base64,',
    ]
  });
  game.fx_bad = new Howl({
    src: [
      'data:audio/mp3;base64,',
      'data:audio/mp4;base64,',
      'data:audio/ogg;base64,',
    ]
  });
  game.fx_seconds = new Howl({
    src: [
      'data:audio/mp3;base64,',
      'data:audio/mp4;base64,',
      'data:audio/ogg;base64,',
    ]
  });
  game.fx_seconds.loop(false);


  //
  game.getFormattedScore = function(){
    var formatedString = '';
    var _scoreArray = game.score.toString().split("");

    // loop through each character
    for(var i = 0; i<_scoreArray.length; i++){
      // update string
      formatedString = formatedString+_scoreArray[i];

      // add a comma every 3 characters
      if(((_scoreArray.length-1) - i )% 3 == 0 && i != (_scoreArray.length-1)){
        formatedString += ',';
      }
    }

    //Return Formatted String
    return formatedString;
  };


  // Game States
  game.state.add('boot', require('./states/boot'));
  game.state.add('gameover', require('./states/gameover'));
  game.state.add('intro', require('./states/intro'));
  game.state.add('features_intro', require('./states/features_intro'));
  game.state.add('features_end', require('./states/features_end'));
  game.state.add('instructions', require('./states/instructions'));
  game.state.add('menu', require('./states/menu'));
  game.state.add('play', require('./states/play'));
  game.state.add('preload', require('./states/preload'));
  

  game.state.start('boot');
}
